  \"2013-03-16T00:47:29.463479\",\n\t\"name\": \"new-mexico-well-headers\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains wellheader features
  compiled by the New Mexico Bureau of Geology and Mineral Resources, and published
  as a Web feature service for the National Geothermal Data System. Fields in the
  Wellheader Feature Content Model will become XML elements in interchange documents
  for WMS simple features provided by a node in the USGIN network. Each observation
  includes a WellName, WellType, Latitude and Longitude spatially referenced to EPSG:
  4326 (for interoperability). The data contained in the submitted dataset is available
  as an Excel Spreadsheet, ESRI service, WMS and WFS service. Link to Wellheader Feature
  Content Model: http://stategeothermaldata.org/data_delivery/content_models/well_header.\",\n\t\"license_title\":
